BEGIN
	DECLARE today DATETIME DEFAULT CURRENT_TIMESTAMP;
    
    SELECT u.`users_id`, u.`full_name`, u.`email`, u.`username`, u.`gender`, u.`birth_date`, u.`user_url`, 
